import React from 'react';
import {
  Container,
  Row,
  Col,
  Button,
  Modal,
  ModalHeader,
  ModalBody,
  ModalFooter
} from 'reactstrap';

export default class Example extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      modal: false
    };

    this.toggle = this.toggle.bind(this);
  }

  toggle() {
    this.setState(prevState => ({
      modal: !prevState.modal
    }));
  }

  render() {
    return (
      <Container>
        {' '}
        <Row>
          <Col xs="6" sm="4">
            <Button color="secondary" size="lg">
              Large Button
            </Button>
          </Col>
          <Col xs="6" sm="4">
            .col-6 .col-sm-4
          </Col>
          <Col sm="4">
            <Button color="secondary" size="lg" onClick={this.toggle}>
              {this.props.buttonLabel}> Explain
            </Button>
          </Col>
        </Row>
      </Container>
    );
  }
}
